# 22.2 s ± 1.17 s per loop (mean ± std. dev. of 7 runs, 1 loop each), len(arr) = 68551, x = 10000
def segment(x, arr):
    minval = float("-inf")
    gen_exp = (min(arr[i:i+x]) for i in range(len(arr) - (x-1))) # generator to iterate over the list, get the min for every n elements
    for k in gen_exp:
        if k <= minval:
            continue
        else: minval = k
    return minval

# 58.7 s ± 11.7 s per loop (mean ± std. dev. of 7 runs, 1 loop each), len(arr) = 68551, x = 10000
def segment2(x, arr):
    minval = float("-inf")
    for i in [arr[j:j + x] for j in range(len(arr) - (x - 1))]:
        l = i
        heapq.heapify(l)
        minheap = l[0]
        if minheap <= minval:
            continue
        else: minval = minheap
    return minval

