def segment3(x, arr):
    maxheap = [float("inf")]                                                # For seeding the max heap
    gen_exp = (list(set(arr[i:i + x])) for i in range(len(arr) - (x - 1)))  # generator to iterate over the list, get sublists for every x elements. Get set to remove duplicates
    for i in gen_exp:                                                       # get each sublist from the generator
        heapq.heapify(i)                                                    # create a heap of each deduped sub-array to find the min
        if -i[0] >= maxheap[0]: continue                                    # check to see if head node of the min heap is greater than the max of the min heaps
        else: heapq.heappush(maxheap, -i[0])                                # if this sub array's min is greater than any previous, then add to the max heap. This keeps the max heap to the smallest size possible.

    return -maxheap[0]

